import React from "react";
import {
  Card,
  CardContent,
  CardMedia,
  CardHeader,
  Typography,
  withStyles
} from "@material-ui/core";
import { grey, blueGrey } from "@material-ui/core/colors";

import discMania from "../../../images/discmania.png";

const styles = {
  card: {
    height: 250,
    width: 175
  },
  media: {
    height: 100,
    width: 175,
    backgroundSize: "contain",
    backgroundRepeat: "no-repeat",
    opacity: 0.5
  },
  content: {
    height: 150,
    width: 175,
    padding: 0
  },
  header: {
    paddingTop: 5,
    paddingBottom: 5
  },
  ratingsContainer: {
    display: "flex",
    justifyContent: "center"
  },
  rating: {
    padding: "0 5px"
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Card raised className={classes.card}>
      <CardMedia
        title="DiscMania Logo"
        image={discMania}
        className={classes.media}
      />
      <CardContent className={classes.content}>
        <CardHeader
          title="DD3"
          subheader="Distance Driver"
          className={classes.header}
        />
        <div className={classes.ratingsContainer}>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
        </div>
      </CardContent>
    </Card>
  );
});
